import React, { Component } from "react";
import axios from "axios";



export default class WorkoutSelector extends Component {
    constructor(props) {
        super(props);
        this.state = {
            workouts: []
        };
    }

    componentDidMount = () => {

        axios.get("/getworkouts")
        .then(function(workouts) {
            this.setState({workouts: workouts});
        })
        .catch(err)
    };
    render() {
        return (
            <div className="col-md-4 offset-md-1">
                <h1>Selection <i class="fa fa-plus"></i></h1>
                <ul id="selectionList">
                    { this.state.workouts.map( workouts => {
                        return <li><span className="plus"><i class="fa fa-plus"></i></span>{workouts.title}</li>
                    })}
                   
                </ul>
            </div>
        )
    }
};
